import React from 'react';
import '../style/index.css';
import Logo from './logo'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import user from '../assets/user.png';
import ButtonDropdown from './buttons'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import logo from "../assets/footer-logo-qr.png";

export default function NavbarFunction() {
    return (
        <div className="navbar">

                <Navbar fixed="top" className="navbar-bootstrap">

                        <Navbar.Brand href="#">
                            <img className="logo-footer-qr" src={logo} alt="logo"/>
                        </Navbar.Brand>
                        <Navbar.Toggle/>
                        <Navbar.Collapse className="justify-content-end">
                            <Navbar.Text>
                                Signed in as: <a href="#login">Mark Otto</a>
                            </Navbar.Text>
                        </Navbar.Collapse>
                    <Navbar.Collapse className="justify-content-end">
                            <Navbar.Text>
                                Signed in as: <a href="#login">Mark Otto</a>
                            </Navbar.Text>
                        </Navbar.Collapse>

                </Navbar>

        </div>


    );
};
